import React from "react";

const Dashboard = () => {
  return (
    <div>
      <h1>Dashboard Loaded Successfully</h1>
    </div>
  );
};
const styles = {
    container: {
      display: "flex",
      flexDirection: "column",
      justifyContent: "center",
      alignItems: "center",
      height: "100vh",
      background: "linear-gradient(to right, red, blue)", // Make the background visible
      border: "5px solid green", // Add a border to ensure visibility
    },
    title: {
      fontSize: "36px",
      fontWeight: "bold",
      marginBottom: "40px",
      textAlign: "center",
    },
  };

  export default Dashboard;
